import {Route, useParams} from "react-router-dom";
import {Fragment} from "react";

const QuoteDetail = () => {
    const params = useParams();

    return (
        <Fragment>
            <h1>quote det page</h1>
            <p>{params.quoteId}</p>
            <Route path={`/quotes/${params.quoteId}/comments`}></Route>
        </Fragment>
    );
}

export default QuoteDetail;
